// Action =  y
// Quotient ring basis (V) = 1,x,x^2,x*y,x*y^2,y,y^2,y^3,y^4,
// Available monomials (RR*V) = x^2*y,x*y^3,y^5,1,x,x^2,x*y,x*y^2,y,y^2,y^3,y^4,


void fast_eigenvector_solver(double * eigv, int neig, Eigen::Matrix<double,9,9> &AM, Matrix<std::complex<double>,2,9> &sols) {
	static const int ind[] = { 2,4,8 };	
	// Truncated action matrix containing non-trivial rows
	Matrix<double, 3, 9> AMs;
	double zi[5];
	
	for (int i = 0; i < 3; i++)	{
		AMs.row(i) = AM.row(ind[i]);
	}
	for (int i = 0; i < neig; i++) {
		zi[0] = eigv[i];
		for (int j = 1; j < 5; j++)
		{
			zi[j] = zi[j - 1] * eigv[i];
		}
		Matrix<double, 3,3> AA;
        AA.col(0) = AMs.col(2);
        AA.col(1) = AMs.col(1) + zi[0] * AMs.col(3) + zi[1] * AMs.col(4);
        AA.col(2) = AMs.col(0) + zi[0] * AMs.col(5) + zi[1] * AMs.col(6) + zi[2] * AMs.col(7) + zi[3] * AMs.col(8);
        AA(0,0) = AA(0,0) - zi[0];
        AA(1,1) = AA(1,1) - zi[2];
        AA(2,2) = AA(2,2) - zi[4];


		Matrix<double, 2, 1>  s = AA.leftCols(2).colPivHouseholderQr().solve(-AA.col(2));
        sols(0,i) = s(1);
        sols(1,i) = zi[0];

	}
}



